function createPairAndAddLP() external payable {
    // Only the contract owner can call this function
    require(owner() == msg.sender, "Ownable: caller is not the owner");

    // `swapV2Pair` must already be set
    require(swapV2Pair != address(0), "Pair address not set");

    // Mark the pair as an automated market-maker pair
    automatedMarketMakerPairs[swapV2Pair] = true;
    emit SetAutomatedMarketMakerPair(swapV2Pair, true);

    // Interface to the Uniswap V2 router
    IUniswapV2Router02 router = IUniswapV2Router02(UNISWAP_V2_ROUTER);

    // Add all ETH and token balance held by this contract as liquidity
    router.addLiquidityETH{ value: address(this).balance }(
        address(this),              // token
        balanceOf(address(this)),   // amountTokenDesired
        0,                          // amountTokenMin
        0,                          // amountETHMin
        owner(),                    // to
        block.timestamp             // deadline
    );

    // Create the trading pair if it doesn’t exist
    address factory = router.factory();
    address weth = router.WETH();
    IUniswapV2Factory(factory).createPair(address(this), weth);
}

